import React from "react";

const Navbar = () => {
    return(
        <div style={{ display: "flex", width:'100%', flexWrap:'wrap', backgroundColor:'red' }}>
            <div>Khamilah Nixon | Projects</div>
            <div style={{ alignSelf:"flex-end"}}>
                <a>Home</a>
                <a>Projects</a>
            </div>
        </div>
    );
}

export default Navbar;
